import React from 'react';

import {FiCheck, FiX} from 'react-icons/fi'

import HeaderAluno from '../../components/headerAluno/index';
import Footer from '../../components/footer/index';

import './style.css';

function ConfirmacaoEmpresa(){

    const empresaConfirmar = ()=>{
        return(
            <div className="div-confirmar">
                <h2>NomeEmpresa</h2>
                <div className="confirmar">
                    <img src="" alt="" className="imgExemplo"/>
                    <div>
                        <h3>Email</h3>
                        <h3>Numero</h3>
                    </div>

                    <div>
                        <h3>Cidade/Estado</h3>
                        <h3>CNPJ</h3>
                    </div>

                    <div>
                        <FiCheck className="aceitar"/>
                        <FiX className="recusar"/>
                    </div>
                </div>
            </div>
        );
    }

    return(
        <div>
            <HeaderAluno/>

            <div>
                <div className="div-menu">
                    <h1 className="sublinhar">Confirmação</h1>
                    <h1>Cadastro</h1>
                </div>

                <div className="div-confirmacao">
                    <h2 className="sublinhar">Empresa</h2>
                    <h2>Aluno</h2>
                </div>

                <div className="empresaConfirmar">
                    {empresaConfirmar()}
                    {empresaConfirmar()}
                    {empresaConfirmar()}
                    {empresaConfirmar()}
                </div>
            </div>

            <Footer/>
        </div>
    );
}

export default ConfirmacaoEmpresa;
